import React from 'react';

function Faq() {
    return (
        <div>
            <h1>FAQ</h1>
            <ul>
                <li>Questions 1 about this?</li>
                <li>Questions 2 about that?</li>
                <li>Questions 3 what is this?</li>
                <li>Questions 4 how I can do it?</li>
            </ul>
        </div>
    );
}

export default Faq;
